import CartItem from "./CartItem";

export default function CartItemList({items}) {

    let itemList = [];

    return (
        <div className="CartList">
            {
                items.map((el) => {
                    itemList.push({
                        amount: 0,
                        ...el
                    });
                    const itemsFiltered = items.filter((el, ind) => {
                        let itemRepeat = items.indexOf(el) !== ind;
                        if (itemRepeat) {
                            itemList[itemRepeat].amount += 1
                        }
                    });
                    console.log(itemsFiltered)
                    // return (
                    //     <CartItem amount={0} key={el.id} id={el.id} category={el.category} description={el.description} price={el.price} title={el.title} />    
                    // )
                })
            }
        </div>
    )
}
